import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [movies, setMovies] = useState([]);
  const [recommendations, setRecommendations] = useState([]);
  const [userId, setUserId] = useState(1);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchMovies();
  }, []);

  const fetchMovies = async () => {
    try {
      const response = await axios.get('http://localhost:8000/movies');
      setMovies(response.data);
    } catch (error) {
      console.error('Error fetching movies:', error);
    }
  };

  const getRecommendations = async () => {
    setLoading(true);
    try {
      const response = await axios.post('http://localhost:3001/recommend', { user_id: userId });
      setRecommendations(response.data.recommendations);
    } catch (error) {
      console.error('Error getting recommendations:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>🎬 AI Movie Recommendation Engine</h1>
        <p>Discover your next favorite movie with AI-powered suggestions</p>
      </header>
      <main>
        <section className="hero">
          <h2>Get Personalized Movie Recommendations</h2>
          <div className="recommendation-controls">
            <label htmlFor="userId">Enter User ID:</label>
            <input
              id="userId"
              type="number"
              value={userId}
              onChange={(e) => setUserId(e.target.value)}
              min="1"
              max="3"
            />
            <button onClick={getRecommendations} disabled={loading}>
              {loading ? 'Getting AI Recommendations...' : 'Get AI Suggestions'}
            </button>
          </div>
        </section>

        {recommendations.length > 0 && (
          <section className="recommendations">
            <h2>🎯 AI-Recommended Movies for You</h2>
            <p>Based on your preferences, our AI suggests these movies:</p>
            <div className="movie-grid">
              {recommendations.map(rec => (
                <div key={rec.movie_id} className="movie-card">
                  <div className="movie-poster">
                    <img src={`https://via.placeholder.com/200x300?text=${rec.title}`} alt={rec.title} />
                  </div>
                  <div className="movie-info">
                    <h3>{rec.title}</h3>
                    <p>Genre: {rec.genre} • Year: {rec.year}</p>
                    <p>AI Confidence: {(rec.score * 100).toFixed(0)}%</p>
                  </div>
                </div>
              ))}
            </div>
          </section>
        )}

        <section className="movies">
          <h2>📽️ Available Movies</h2>
          <div className="movie-grid">
            {movies.map(movie => (
              <div key={movie.id} className="movie-card">
                <div className="movie-poster">
                  <img src={`https://via.placeholder.com/200x300?text=${movie.title}`} alt={movie.title} />
                </div>
                <div className="movie-info">
                  <h3>{movie.title}</h3>
                  <p>Genre: {movie.genre} • Year: {movie.year}</p>
                  <p>Rating: {movie.rating}/10</p>
                </div>
              </div>
            ))}
          </div>
        </section>
      </main>
      <footer>
        <p>Powered by AI • Built with React & Python</p>
      </footer>
    </div>
  );
}

export default App;
